import React, { Component } from 'react' ;

// component 객체를 생성
class App extends Component 
{
  state = {
    hello: 'hello app js!'
  } ;

  // Component class에 있던 render() method를 사용
  render()
  {
    return <div className="App">hello app js!</div> ;
  }
}

// 만들어진 객체를 반환한다. 
export default App ;
